import * as React from "react";
import { Text } from "react-native";

export function ItemCard() {
  return (
    <View
      style={{
        width: "100%",
        height: "60px",
        backgroundColor: "white",
        boxShadow:
          "0 4px 8px 0 rgba(0, 0, 0, 0.2), 0 6px 20px 0 rgba(0, 0, 0, 0.19)",
        borderRadius: "3px"
      }}
    ></View>
  );
}
